import React from 'react';
import classes from './ToDoList.module.scss';

const styles = {
    ul: {
        listStyle: 'none',
        margin: 0,
        padding: 0,
        color: 'white',
        fontWeight: 600
    }
}

const ToDoItem = () => {
    return (
        <div className={classes.toDoItem}>
                <li>ToDoList</li>
        </div>
    )
}

export default ToDoItem;
